CREATE TABLE `logs` (  `log_id` mediumint(8) unsigned NOT NULL auto_increment,  `log_title` varchar(40) NOT NULL default '',  `log_time` int(11) unsigned NOT NULL default '0',  `log_user` varchar(40) NOT NULL default '',  `log_ip` varchar(20) NOT NULL default '',  PRIMARY KEY  (`log_id`)) TYPE=MyISAM AUTO_INCREMENT=7 ;
