CREATE TABLE `stores` (  `id` mediumint(8) unsigned NOT NULL auto_increment,  `post_code` varchar(9) NOT NULL default '',  `post_code_full` varchar(9) NOT NULL default '',  `address` mediumtext NOT NULL,  `area` varchar(60) NOT NULL default '',  `telephone` varchar(14) NOT NULL default '0',  KEY `id` (`id`),  KEY `post_code` (`post_code`)) TYPE=MyISAM AUTO_INCREMENT=1 ;